pragma solidity 0.4.23;

contract Set{
    string public nolanStr;
    struct student {
        uint id;
        string fName;
        string lName;
    }

    uint student_counter = 0;
    mapping(uint=>student) public studentClass;
    
    function addStudent(uint vnum, string memory fName, string memory lName) public{
        studentClass[vnum] = student(vnum, fName, lName);
    }


    constructor() public {
        nolanStr = "hello nn";
    }

    function set(string _str) public {
        nolanStr = _str;
    }

    function get() public view returns(string) {
        return nolanStr;
    }
}
